import React from 'react';
import './AboutSection.css';

const AboutSection = () => {
  return (
    <section className="about">
      <h1>About Us</h1>
      <p>Welcome to Project Kyan! We're passionate about creating innovative solutions...</p>
    </section>
  );
};

export default AboutSection;
